import React from 'react';
import { render } from 'react-dom';

import Accordion from './components/Accordion';
import Transaction from './components/Transaction';

function App() {
  return (
    <div>
      <h1>Transactions</h1>
      <Accordion>
        <div label='Alligator Mississippiensis'>
          <Transaction
                  id="here goes the id"
                  type="credit"
                  amount="0.9"
                  date="date of Transactions"
              >
            </Transaction>
        </div>
        <div label='Alligator Sinensis'>
          <Transaction
                  id="here goes the id"
                  type="credit"
                  amount="0.9"
                  date="date of Transactions"
              >
            </Transaction>
        </div>
      </Accordion>
    </div>
  );
}

export default App;
